import {
  Autocomplete,
  Button,
  Dialog,
  DialogActions,
  DialogContent,
  DialogTitle,
  TextField,
} from "@mui/material";
import { FunctionComponent, useCallback } from "react";
import { FilterModalProps } from "./types";
import { useForm } from "react-hook-form";
import { CarsProps } from "../../../utils/types/Cars";

const FilterModal: FunctionComponent<FilterModalProps> = ({
  open,
  onClose,
  onFilter,
  data,
}) => {
  const marca = data
    .map(({ marca }) => marca)
    .reduce((acc, value) => {
      const found = acc.find((t) => t === value);
      !found && acc.push(value);
      return acc;
    }, []);
  const { handleSubmit, register } = useForm<CarsProps>();

  const onSubmit = useCallback((data: any) => {
    console.log(data);
  }, []);

  const handleClose = useCallback(() => onClose(), [onClose]);
  return (
    <Dialog open={open} onClose={handleClose}>
      <DialogTitle>Selecione os filtros</DialogTitle>
      <DialogContent>
        <form onSubmit={handleSubmit(onSubmit)}>
          <Autocomplete
            id="free-solo-demo"
            freeSolo
            options={[1, 2, 5, 6, 4]}
            renderInput={(params) => (
              <TextField
                {...register("marca", {})}
                name="marca"
                {...params}
                label="Marca"
              />
            )}
          />
        </form>
      </DialogContent>
      <DialogActions>
        <Button onClick={handleClose}>Cancelar</Button>
        <Button type="submit">Filtrar</Button>
      </DialogActions>
    </Dialog>
  );
};

export default FilterModal;
